import { useEffect, useState } from "react";
import "./App.css";

const App = () => {
  const [cases, setCases] = useState(0);
  useEffect(() => {
    fetch("/global-data")
      .then((res) => res.json())
      .then((data) => {
        setCases(data[0].confirmed);
      });
  }, []);
  return (
    <div>
      <h1>{cases}</h1>
    </div>
  );
};

export default App;
